import React, { useState, useEffect } from 'react';
import { adminBlogAPI, adminProjectAPI } from '../services/api';

const DashboardPage = () => {
    const [stats, setStats] = useState({
        totalBlogs: 0,
        totalProjects: 0,
        publishedBlogs: 0,
        draftBlogs: 0
    });
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        fetchStats();
    }, []);

    const fetchStats = async () => {
        try {
            // Fetch blogs data
            const blogsResponse = await adminBlogAPI.getAll(1, 1000); // Get all blogs for counting
            const blogs = blogsResponse.data.blogs;
            
            // Fetch projects data
            const projectsResponse = await adminProjectAPI.getAll();
            const projects = projectsResponse.data;

            // Calculate stats
            const publishedBlogs = blogs.filter(blog => blog.published).length;
            const draftBlogs = blogs.filter(blog => !blog.published).length;

            setStats({
                totalBlogs: blogs.length,
                totalProjects: projects.length,
                publishedBlogs,
                draftBlogs
            });
        } catch (error) {
            console.error('Error fetching stats:', error);
        } finally {
            setLoading(false);
        }
    };

    if (loading) {
        return <div className="loading">Loading dashboard...</div>;
    }

    return (
        <div className="dashboard-page">
            <div className="page-header">
                <h1>Dashboard</h1>
                <p>Welcome to your portfolio admin panel</p>
            </div>
            
            <div className="stats-grid">
                <div className="stat-card">
                    <div className="stat-icon">üìù</div>
                    <div className="stat-info">
                        <h3>Total Blogs</h3>
                        <p className="stat-number">{stats.totalBlogs}</p>
                    </div>
                </div>
                
                <div className="stat-card">
                    <div className="stat-icon">üöÄ</div>
                    <div className="stat-info">
                        <h3>Total Projects</h3>
                        <p className="stat-number">{stats.totalProjects}</p>
                    </div>
                </div>
                
                <div className="stat-card">
                    <div className="stat-icon">‚úÖ</div>
                    <div className="stat-info">
                        <h3>Published Blogs</h3>
                        <p className="stat-number">{stats.publishedBlogs}</p>
                    </div>
                </div>
                
                <div className="stat-card">
                    <div className="stat-icon">üìã</div>
                    <div className="stat-info">
                        <h3>Draft Blogs</h3>
                        <p className="stat-number">{stats.draftBlogs}</p>
                    </div>
                </div>
            </div>

            <div className="recent-activity">
                <div className="activity-section">
                    <h3>Quick Actions</h3>
                    <div className="action-buttons">
                        <button 
                            className="btn-primary" 
                            onClick={() => window.location.href = '/blogs'}
                        >
                            Manage Blogs
                        </button>
                        <button 
                            className="btn-primary" 
                            onClick={() => window.location.href = '/projects'}
                        >
                            Manage Projects
                        </button>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default DashboardPage;
